class TestNearQuickNodeApiCalls(TestCase):
    api = NearQuickNodeApi
    from_block = 135688874
    to_block = 135688876

    @classmethod
    def check_general_response(cls, response, keys):
        if set(response.keys()).issubset(keys):
            return True
        return False

    @pytest.mark.slow
    def test_get_blocks_txs(self):
        get_blocks_txs_response = self.api.get_batch_block_txs(from_block=self.from_block, to_block=self.to_block, )
        assert get_blocks_txs_response and isinstance(get_blocks_txs_response, list)
        for block_txs_response in get_blocks_txs_response:
            assert block_txs_response and isinstance(block_txs_response, dict)
            assert block_txs_response.get('result') and isinstance(block_txs_response.get('result'), dict)
            assert block_txs_response.get('result').get('header') and isinstance(
                block_txs_response.get('result').get('header'), dict)
            assert block_txs_response.get('result').get('transactions') is not None and isinstance(
                block_txs_response.get('result').get('transactions'), list)
            for transaction in block_txs_response.get('result').get('transactions'):
                assert transaction and isinstance(transaction, dict)
                assert transaction.get('hash') and isinstance(transaction.get('hash'), str)
                assert transaction.get('receiver_id') and isinstance(transaction.get('receiver_id'), str)
                assert transaction.get('signer_id') and isinstance(transaction.get('signer_id'), str)
                assert transaction.get('actions') and isinstance(transaction.get('actions'), list)
                if transaction.get('actions')[0] and transaction.get('actions')[0].get('Transfer'):
                    assert transaction.get('actions')[0].get('Transfer').get('deposit')


